import { createMuiTheme } from '@matrial-ui/core/styles';

const theme = createMuiTheme({
    palette: {
        primary: {
            light: "#63a4fff",
            main: "#1976d2",
            dark: "#004ba0",
            ContrastText: "#ecfad8"
        }
    }
});

export default theme;
